sourcesContent:
import bcrypt from 'bcrypt';
import { raw } from 'body-parser';
import db from '../models/index';
let handlerUserLogin = (email, password) => {
    return new Promise(async (resolve, reject) => {
        try {
            let userData = {};

            let isExist = await checkUserEmail(email);

            if (isExist) {
                let user = await db.User.findOne({
                    where: { email: email }, attributes: ['email', 'roleId', 'password'],
                    raw: true

                })

                let check = await bcrypt.compare(password, user.password);

                if (check) {

                    userData.errCode = 0;
                    userData.errMessage = `login sucsess`;
                    delete user.password;
                    userData.user = user;
                    resolve(userData);
                } else {
                    userData.errCode = 3;
                    userData.errMessage = `password are wrong`;
                    resolve(userData);
                }
            } else {
                userData.errCode = 2;
                userData.errMessage = `your email is fucking shit. do fucking it again!`;

                resolve(userData);
            }
        } catch (error) {
            reject(error)
        }
    })
}

let checkUserEmail = (userEmail) => {
    return new Promise(async (resolve, reject) => {
        try {
            let user = await db.User.findOne({ where: { email: userEmail } });

            if (user) {
                resolve(true);
            } else { resolve(false) };
        } catch (error) {
            reject(error);
        }
    })
}

module.exports = {
    handlerUserLogin: handlerUserLogin
}

